import React, { Component } from 'react'
import './Title.css'
import myCourseWorkData from '../Content/activeWorkData'
import completedWorksData from '../Content/completedWorksData'
import { isNumber } from 'util';

interface Props{
    page? : string
}

interface State{
}

class Title extends Component<Props,State>{
    constructor(props:Props){
        super(props);
        this.state = {
        }
    }

    private whichTitle(){
        if(this.props.page === 'Моя курсовая детально'){
            return <p className='title-text'>{myCourseWorkData[0].title}</p>
        }
        else if (Number(this.props.page)){
            return <p className='title-text'>{completedWorksData[Number(this.props.page)].title}</p>
        }
        return <p className='title-text'>{this.props.page}</p>
    }


    render(){
    return(
        <div className='title'>
            {this.whichTitle()}
            <hr/>
        </div>
    )
    }
}

export default Title
